Meet 5-year-old Delilah and 2-year-old Cesar.

THESE are the faces of kids who will lose health care when Republicans cut at least $880 billion from Medicaid/Medi-Cal.

@SenAlexPadilla and I will keep sharing these amazing stories and fighting for everyone who relies on Medicaid. https://t.co/0GZVd1J2pd
